// import components
import PublicRoute from "../utils/PublicRoute.js";

const Work = () => {
  const content = (
    <>
      <div className="work-options">
        <div className="work-option">SITES</div>
        <div className="work-option">APPS</div>
        <div className="work-option">GAMES</div>
        <div className="work-option">MISC</div>
      </div>
    </>
  );

  return <PublicRoute content={content} />;
};

export default Work;
